    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div className="Area SignInArea">
                <h1>ログイン</h1>
                <SignInForm />
                <style jsx>{`
                    .SignInArea {
                        background-color: #262F42;
                    }
                    h1 {
                        color: #fff;
                    }
                `}</style>
            </div>
        )
    }
}
